  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:04.818540\",\n\t\"name\": \"analysis-of-2007-2014-ouray-national-wildlife-refuge-deer-and-elk-survey-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A population survey for deer and elk on
  Ouray National Wildlife Refuge was established in 2007 and conducted through 2014.
  The purpose of the survey was to establish a baseline population and to determine
  of the survey could detect changes in the population that may be the result of Chronic
  Wasting Disease. Chronic wasting disease (CWD) was first found in Utah in 2002 in
  the county and Wildlife Management Unit (WMU) that Ouray National Wildlife Refuge
  (Refuge) is within. While a positive CWD sample has not been found in or nearby
  the Refuge it may just be a matter of time. In 2007 a population survey was established
  using Distance Sampling methods to provide a baseline population for deer and elk
  and to determine if the survey was sensitive enough to detect changes in populations
  of deer and elk that may occur if CWD were to be on the Refuge. The survey was conducted
  from 2007 through 2014 and the data was analyzed using the Distance program.\",\n\t\"license_title\":
